const queue=window._deferQueue||[];window.defer=(e=>{queue.push(e)}),document.addEventListener("DOMContentLoaded",()=>{for(document.querySelectorAll("[up-nav=include-query]").forEach(e=>{e.querySelectorAll("a").forEach(e=>{const t=e.href||e.getAttribute("up-href");if(!t)return;const u=e.getAttribute("up-alias")||"";e.setAttribute("up-alias",u+" "+t+"?*")})});queue.length;)queue.shift().call()});
